class LengthOfLongestSubString {
    fun lengthOfLongestSubstring(string: String): Int {
        //boolean[] charactersSoFar = new boolean[128];
        val skipCharacters = IntArray(128)
        val s = string.toCharArray()
        for (i in skipCharacters.indices) skipCharacters[i] = -1
        var length = 0
        var currentLength = 0
        var i = 0
        var oldStart = 0
        while (i < s.size) {
            while (i < s.size && skipCharacters[s[i].code] == -1) {
                skipCharacters[s[i].code] = i
                currentLength++
                i++
            }
            length = Math.max(length, currentLength)
            if (i < s.size) {
                val newStart = skipCharacters[s[i].code] + 1
                currentLength = i - newStart + 1
                skipCharacters[s[i].code] = i
                for (j in oldStart until newStart) {
                    skipCharacters[s[j].code] = -1
                }
                skipCharacters[s[i].code] = i
                oldStart = newStart
                i++
            }
        }
        return length
    }

